<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Create Beat Plan</title>
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet">
    <script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js"></script>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: #f8f9fa;
        }
        .container {
            max-width: 600px;
            background: white;
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        }
        @media print {
          body * {
            visibility: hidden;
          }
          .container, .container * {
            visibility: visible;
          }
          .container {
            position: absolute;
            left: 0;
            top: 0;
          }
        }
    </style>
</head>
<body>
    <div class="container">
        <h3 class="text-center">Create Beat Plan</h3>
        <form id="myForm" class="mb-4">
            <div class="mb-3">
                <label for="fo_name" class="form-label">FO Name:</label>
                <input type="text" id="fo_name" class="form-control" required>
            </div>
            <button type="button" id="lockBtn" class="btn btn-warning mb-3" onclick="lockFields()">Lock FO Name</button>
            <button type="button" id="unlockBtn" class="btn btn-secondary mb-3 d-none" onclick="unlockFields()">Edit FO Name</button>
            <div class="mb-3">
                <label for="date" class="form-label">Date:</label>
                <p style="color: red;">* Please change after 4 sites.</p>
                        <input type="date" id="date" class="form-control" onchange="handleDateChange()" required>
            </div>
            <div class="mb-3">
                <label for="indus_id" class="form-label">Indus ID:</label>
                <input type="text" id="indus_id" class="form-control" oninput="autoFillSiteAndType()" required>
            </div>
            <div class="mb-3">
                <label for="site_id" class="form-label">Site ID:</label>
                <input type="text" id="site_id" class="form-control" readonly required>
            </div>
            <div class="mb-3">
                <label for="tower_type" class="form-label">Tower Type:</label>
                <input type="text" id="tower_type" class="form-control" readonly required>
            </div>
            <button type="button" class="btn btn-primary" onclick="addData()">Add Data</button>
            <button type="button" class="btn btn-info" onclick="downloadJPG()">Download JPG</button>
        </form>
        <div id="tableContainer">
            <table class="table table-bordered">
                <thead class="table-dark">
                    <tr>
                        <th>Serial No.</th>
                        <th>FO Name</th>
                        <th>Date</th>
                        <th>Indus ID</th>
                        <th>Formatted Indus ID</th>
                        <th>Site ID</th>
                        <th>Tower Type</th>
                    </tr>
                </thead>
                <tbody id="dataTable"></tbody>
            </table>
        </div>
    </div>
    <script>
        let dataRows = [];
        let entryCount = 0;
        let currentDate = document.getElementById("date").value;

        document.getElementById("date").valueAsDate = new Date();
        function lockFields() {
            document.getElementById("fo_name").setAttribute("disabled", "true");
            document.getElementById("lockBtn").classList.add("d-none");
            document.getElementById("unlockBtn").classList.remove("d-none");
        }
        function unlockFields() {
            document.getElementById("fo_name").removeAttribute("disabled");
            document.getElementById("lockBtn").classList.remove("d-none");
            document.getElementById("unlockBtn").classList.add("d-none");
        }
        function resetEntryCount() {
            entryCount = 0;
        }

        function handleDateChange() {
            const newDate = document.getElementById("date").value;
            if (newDate !== currentDate) {
                entryCount = 0;
                currentDate = newDate;
                dataRows = [];
                document.getElementById("dataTable").innerHTML = '';
            }
        }

        function autoFillSiteAndType() {
            let indusId = document.getElementById('indus_id').value;
            let siteField = document.getElementById('site_id');
            let typeField = document.getElementById('tower_type');
            if (siteData[indusId]) {
                siteField.value = siteData[indusId].site;
                typeField.value = siteData[indusId].type;
            } else {
                siteField.value = "";
                typeField.value = "";
            }

        }
        function handleDateChange() {
    let newDate = document.getElementById("date").value;
    currentDate = newDate;
    
    if (!allData[currentDate]) {
        allData[currentDate] = [];
    }

    displayData(); // Refresh table data
}

        function addData() {
            if (entryCount >= 24) {
                alert("You have reached the maximum limit of 24 entries.");
                return;
            }
            if (entryCount > 0 && entryCount % 24 === 0) {
                alert("You have added 4 entries. Please change the date before adding more.");
                return;
            }
            let foName = document.getElementById('fo_name').value;
            let date = document.getElementById('date').value;
            let indusId = document.getElementById('indus_id').value;
            let formattedIndusId = "IN-" + indusId;
            let siteId = document.getElementById('site_id').value;
            let towerType = document.getElementById('tower_type').value;
            if (!foName || !date || !indusId || !siteId || !towerType) {
                alert("Please fill all required fields before adding data.");
                return;
            }
            if (towerType === "RTT") {
                alert("RTT sites cannot be added.");
                return;
            }
            if (dataRows.some(row => row[3] === formattedIndusId)) {
                alert("Duplicate Formatted Indus ID is not allowed.");
                return;
            }
             if (dataRows.some(row => row[2] === date && row[3] === indusId)) {
                alert("Duplicate Indus ID for the same date is not allowed.");
                return;
            }
            dataRows.push([entryCount + 1,foName, date, indusId, formattedIndusId, siteId, towerType]);
            let tableBody = document.getElementById("dataTable");
            let newRow = tableBody.insertRow();
            newRow.insertCell(0).innerText = entryCount + 1;
            newRow.insertCell(1).innerText = foName;
            newRow.insertCell(2).innerText = date;
            newRow.insertCell(3).innerText = indusId;
            newRow.insertCell(4).innerText = formattedIndusId;
            newRow.insertCell(5).innerText = siteId;
            newRow.insertCell(6).innerText = towerType;
            entryCount++;
            document.getElementById('indus_id').value = "";
            document.getElementById('site_id').value = "";
            document.getElementById('tower_type').value = "";
        }
        function downloadJPG() {
            html2canvas(document.getElementById('tableContainer')).then(function(canvas) {
                var link = document.createElement('a');
                link.href = canvas.toDataURL('image/jpeg');
                link.download = 'beat_plan.jpg';
                link.click();
            });
        }
